import React, { Component } from 'react'

export class Excersize extends Component {
    state = {
        type: '',
        length: 0,
    }
    onChange = (e) => {
        this.setState({type: e.target.value});
        console.log(this.state);
    }
  render() {
    return (
      <div>
        <label className="Type">
            Ran
            <input type="checkbox" value="Ran"></input>
            <div></div>
            Biked
            <input type="checkbox" value="Biked"></input>
            <div></div>
            Upper body
            <input type="checkbox" value="Upper"></input>
            <div></div>
            Lower body
            <input type="checkbox" value="Lower"></input>
            <div></div>
        </label>
      </div>
    )
  }
}

export default Excersize
